import Home from './Components/Home';
import { Routes, Route } from 'react-router-dom';
import "./Components/style.css"

//<NavBar class="header"/>
//<NavBar class="header"/>
//<Media class="media"/>


export default function App() {
  return (
    <>
      <NavBar />
      <Routes>
        <Route path='/' element={<Home/>} />
      </Routes>
    </>

  );
}
